insert  into `clause_content`(`id`,`clause_id`,`is_title`,`title_level`,`content`,`order`,`delete`) values (3425,48,0,'','这是内容吗',1,1),(3426,48,1,'h1','那这就是标题咯',2,1),(3427,50,0,'','200',1,1),(3428,51,0,'','2',1,1),(3429,52,0,'','30',1,1),(3430,53,0,'','4',1,1),(3431,54,0,'','兴仁农商银行办公室文件',0,1),(3432,54,0,'','兴仁农商银办发〔2017〕262号',1,1),(3433,54,0,'','兴仁农商银行办公室关于严禁发放多头贷款的通知',2,1),(3434,54,0,'','各支行：',3,1),(3435,54,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',4,1),(3436,54,0,'','一、多头贷款的定义',5,1),(3437,54,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',6,1),(3438,54,0,'','二、相关要求',7,1),(3439,54,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',8,1),(3440,54,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',9,1),(3441,54,0,'','兴仁农商银行办公室',10,1),(3442,54,0,'','                                     2017年10月9日',11,1),(3443,54,0,'','                                               共印48份',12,1),(3444,55,0,'','各支行：',0,1),(3445,55,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',1,1),(3446,55,0,'','一、多头贷款的定义',2,1),(3447,55,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',3,1),(3448,55,0,'','二、相关要求',4,1),(3449,55,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',5,1),(3450,55,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',6,1),(3451,55,0,'','兴仁农商银行办公室',7,1),(3452,55,0,'','                                     2017年10月9日',8,1),(3453,55,0,'','                                               共印48份',9,1),(3454,56,0,'','',0,1),(3455,56,0,'','各支行：',1,0),(3456,56,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',2,0),(3457,56,0,'','一、多头贷款的定义',3,0),(3458,56,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',4,0),(3459,56,0,'','二、相关要求',5,0),(3460,56,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',6,0),(3461,56,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',7,0),(3462,56,0,'','',8,1),(3463,56,0,'','兴仁农商银行办公室',8,0),(3464,56,0,'','                                     2017年10月9日',9,0),(3465,56,0,'','',11,1),(3466,56,0,'','                                               共印48份',10,0),(3467,56,0,'','',13,1),(3468,56,0,'','',14,1),(3469,57,0,'','根据《省联社办公室关于开展2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（黔农信办发〔2018〕392号）及《兴仁农商银行办公室关于印发2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（兴仁农商银办发〔2018〕245号 ）中“印章管理”排查要求，总行办公室决定在各支行对印章管理进行自查后，在辖内进行抽查，现将相关事宜通知如下：',0,1),(3470,57,0,'','一、排查内容',1,1),(3471,57,0,'','截止2018年7月末，近1年内行政印章及柜面印章管理和使用情况。',2,1),(3472,57,0,'','二、排查要点',3,1),(3473,57,0,'','（一）行政用章管理',4,1),(3474,57,0,'','1.建立《印章使用登记簿》、《印章交接登记簿》、《印章借用登记簿》等，并根据实际情况，记录相关要素。',5,1),(3475,57,0,'','2.印章实行专人管理，按照“双人制度”，保管时要密码钥匙分离管理。',6,1),(3476,57,0,'','3.印章必须使用保险柜保管，不得随意放置，做到随用随取、人离章收。',7,1),(3477,57,0,'','4.印章管理员变更或因事需交接印章时，要办理交接和登记手续。',8,1),(3478,57,0,'','5.严格履行用印审批手续，凡需加盖印章的文字材料或表格，由支行行长签批。',9,1),(3479,57,0,'','6.违规用印情况,有下列情况的不予用印：',10,1),(3480,57,0,'','（1）未经有权审批人批准的；',11,1),(3481,57,0,'','（2）用印材料与审批情况不一致的；',12,1),(3482,57,0,'','（3）法律性文本用印未按规定提供法律审查意见的；',13,1),(3483,57,0,'','（4）空白页、空白表格；',14,1),(3484,57,0,'','（5）关键信息缺失、字迹模糊的材料；',15,1),(3485,57,0,'','（6）其他有正当理由拒绝用印的情形。',16,1),(3486,57,0,'','7.严格实行登记制度，印章登记簿应记载用印时间、经办人、事由、份数、审批人等关键信息。',17,1),(3487,57,0,'','8.非特殊工作需要，印章原则上不得离行使用，确需带出的，必须报主要负责人批准，由双人带出用印。',18,1),(3488,57,0,'','9.定期开展印章管理自查。',19,1),(3489,57,0,'','    （二）柜面用章管理    ',20,1),(3490,57,0,'','1.刻制的印章要按柜面印章的种类刻制，不得擅自新增和修改柜面业务印章。',21,1),(3491,57,0,'','2.各支行柜面印章要按规定范围使用，不得错用、串用、提前或过期使用会计业务印章，不得未办理交接手续将柜面业务印章交他人使用，不得预先在重要空白凭证上加盖印章备用。',22,1),(3492,57,0,'','3.各支行要按规定对印章管理进行检查，至少每半年自查一次，印章登记簿与印章实物是否相符。',23,1),(3493,57,0,'','4.柜面业务印章使用人要做到“专匣保管、固定存放，人离章收。”临时离岗，应入柜（或箱）保管，入屉上锁，钥匙随身带走；营业终了，入库保管。',24,1),(3494,57,0,'','三、相关要求',25,1),(3495,57,0,'','（一）各支行及时组织开展印章管理自查，形成印章管理自查报告，连同印章管理相关登记簿（内页而不是封面）拍照打包于9月27日前报办公室。',26,1),(3496,57,0,'','（二）对在自查中发现的问题，各支行应查缺补漏，及时进行整改。',27,1),(3497,57,0,'','（三）办公室将根据各支行的自查情况进行抽查。',28,1),(3498,57,0,'','',29,1),(3499,57,0,'','兴仁农商银行办公室',30,1),(3500,57,0,'','                               2018年9月26日',31,1),(3501,57,0,'','',32,1),(3502,58,0,'','',0,1),(3503,58,0,'','各支行：',1,0),(3504,58,0,'','根据《省联社办公室关于开展2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（黔农信办发〔2018〕392号）及《兴仁农商银行办公室关于印发2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（兴仁农商银办发〔2018〕245号 ）中“印章管理”排查要求，总行办公室决定在各支行对印章管理进行自查后，在辖内进行抽查，现将相关事宜通知如下：',2,0),(3505,58,0,'','一、排查内容',3,0),(3506,58,0,'','截止2018年7月末，近1年内行政印章及柜面印章管理和使用情况。',4,0),(3507,58,0,'','二、排查要点',5,0),(3508,58,0,'','（一）行政用章管理',6,0),(3509,58,0,'','1.建立《印章使用登记簿》、《印章交接登记簿》、《印章借用登记簿》等，并根据实际情况，记录相关要素。',7,0),(3510,58,0,'','2.印章实行专人管理，按照“双人制度”，保管时要密码钥匙分离管理。',8,0),(3511,58,0,'','3.印章必须使用保险柜保管，不得随意放置，做到随用随取、人离章收。',9,0),(3512,58,0,'','4.印章管理员变更或因事需交接印章时，要办理交接和登记手续。',10,0),(3513,58,0,'','5.严格履行用印审批手续，凡需加盖印章的文字材料或表格，由支行行长签批。',11,0),(3514,58,0,'','6.违规用印情况,有下列情况的不予用印：',12,0),(3515,58,0,'','（1）未经有权审批人批准的；',13,0),(3516,58,0,'','（2）用印材料与审批情况不一致的；',14,0),(3517,58,0,'','（3）法律性文本用印未按规定提供法律审查意见的；',15,0),(3518,58,0,'','（4）空白页、空白表格；',16,0),(3519,58,0,'','（5）关键信息缺失、字迹模糊的材料；',17,0),(3520,58,0,'','（6）其他有正当理由拒绝用印的情形。',18,0),(3521,58,0,'','7.严格实行登记制度，印章登记簿应记载用印时间、经办人、事由、份数、审批人等关键信息。',19,0),(3522,58,0,'','8.非特殊工作需要，印章原则上不得离行使用，确需带出的，必须报主要负责人批准，由双人带出用印。',20,0),(3523,58,0,'','9.定期开展印章管理自查。',21,0),(3524,58,0,'','    （二）柜面用章管理    ',22,0),(3525,58,0,'','1.刻制的印章要按柜面印章的种类刻制，不得擅自新增和修改柜面业务印章。',23,0),(3526,58,0,'','2.各支行柜面印章要按规定范围使用，不得错用、串用、提前或过期使用会计业务印章，不得未办理交接手续将柜面业务印章交他人使用，不得预先在重要空白凭证上加盖印章备用。',24,0),(3527,58,0,'','3.各支行要按规定对印章管理进行检查，至少每半年自查一次，印章登记簿与印章实物是否相符。',25,0),(3528,58,0,'','4.柜面业务印章使用人要做到“专匣保管、固定存放，人离章收。”临时离岗，应入柜（或箱）保管，入屉上锁，钥匙随身带走；营业终了，入库保管。',26,0),(3529,58,0,'','三、相关要求',27,0),(3530,58,0,'','（一）各支行及时组织开展印章管理自查，形成印章管理自查报告，连同印章管理相关登记簿（内页而不是封面）拍照打包于9月27日前报办公室。',28,0),(3531,58,0,'','（二）对在自查中发现的问题，各支行应查缺补漏，及时进行整改。',29,0),(3532,58,0,'','（三）办公室将根据各支行的自查情况进行抽查。',30,0),(3533,58,0,'','',31,1),(3534,58,0,'','兴仁农商银行办公室',31,0),(3535,58,0,'','                               2018年9月26日',32,0),(3536,58,0,'','',34,1),(3537,59,0,'','第二条  本办法所称贷款人是指各县（市、区）农村信用合作联社、农村商业银行 (以下统称行社)及其授权办理农户贷款的分支机构（以下简称网点）。',0,1),(3538,59,0,'','第三条  本办法所称农户贷款，是指贷款人向符合条件的农户发放的用于生产经营、生活消费等用途的人民币贷款。',1,1),(3539,59,0,'','本办法所称农户是指长期居住在乡镇和城关镇所辖行政村的住户、国有农场的职工和农村个体工商户。',2,1),(3540,59,0,'','第四条  农户贷款实行“差异授信、灵活定价、风险可控、流程简化、特色服务”的信贷支农服务政策。',3,1),(3541,59,0,'','第五条  贷款人按照“先评级、后授信、再用信”的流程管理农户贷款。针对不同的农户贷款产品，可以采取差异化的办理流程。',4,1),(3542,59,0,'','第六条  贷款人经营农户贷款业务，应遵守本办法。',5,1),(3543,59,0,'','',6,1),(3544,59,1,'h1','第二章  管理架构及职责',7,1),(3545,59,0,'','第七条  行社成立农户贷款管理委员会，经营层负责人任组长，分管领导任副组长，业务、财会、风险、稽核等部门负责人为成员，办公室设在农户贷款业务主管部门。工作职责如下：',8,1),(3546,59,0,'','（一）贯彻落实农村经济金融政策，加大服务“三农”力度。',9,1),(3547,59,0,'','（二）制定行社农户贷款业务发展规划，改进服务方式，提升服务质量，提高农户的满意度和获得感。',10,1),(3548,59,0,'','（三）研究制定农户贷款产品、渠道、营销等策略，不断夯实农村市场。',11,1),(3549,59,0,'','（四）加强农户贷款风险管控研究分析，有效防控农户贷款业务风险。',12,1),(3550,59,0,'','（五）科学合理配置农户贷款业务客户经理、经费等资源，支持农户贷款业务健康发展。',13,1),(3551,59,0,'','（六）督促网点成立农户信用等级评定小组和农户授信审批小组，持续监测履职效能，提升和完善服务机制，不断增强服务能力和水平。',14,1),(3552,59,0,'','（七）每半年至少召开一次农户贷款业务专题会，就信贷政策、信用工程、风险管控及评级授信、利率定价、线上放贷、经验做法和存在问题等情况进行专题研究，提出合理化的工作措施，推动工作质效持续提升。',15,1),(3553,59,1,'h1','第三章  贷款条件、用途和种类',16,1),(3554,59,0,'','第八条  贷款条件。借款人应具备以下条件：',17,1),(3555,59,0,'','（一）借款人在18周岁以上，具有完全民事行为能力且身体健康的自然人。',18,1),(3556,59,0,'','（二）居住在贷款人服务区域内的农户且在本地拥有自有住房或固定的生产经营场所。',19,1),(3557,59,0,'','（三）所从事的生产经营活动符合法律法规及产业政策。',20,1),(3558,59,0,'','（四）贷款申请数额、期限合理，符合生产经营活动、消费行为的合理需求。',21,1),(3559,59,0,'','（五）具有按期偿还贷款本息的能力。',22,1),(3560,59,0,'','（六）借款人遵纪守法，品行良好，无恶意逃废债务行为，无重大不良信用记录。',23,1),(3561,59,0,'','（七）贷款发放前，在贷款人处开立个人银行结算账户，自愿接受信贷监督和支付结算监督。',24,1),(3562,59,0,'','（八）贷款人要求的其他条件。',25,1),(3563,59,0,'','第九条  贷款用途。农户贷款应当符合法律法规规定和国家有关政策，不得发放无指定用途的农户贷款。按照用途分类，农户贷款分为农户生产经营贷款和农户消费贷款。',26,1),(3564,59,0,'','（一）农户生产经营贷款是指贷款人发放给农户用于生产经营活动的贷款，包括农户农、林、牧、渔业生产经营贷款和农户就业创业等其他生产经营贷款。',27,1),(3565,59,0,'','（二）农户消费贷款是指贷款人发放给农户用于生活消费、建房、医疗、教育等需求的贷款。',28,1),(3566,59,0,'','第十条  贷款种类。按信用形式分类，农户贷款包括但不限于：',29,1),(3567,59,0,'','（一）农户小额信用贷款。',30,1),(3568,59,0,'','（二）农户保证贷款（含农户最高额保证贷款、农户联保贷款）。',31,1),(3569,59,0,'','（三）农户抵押贷款（含农户最高额抵押贷款）。',32,1),(3570,59,0,'','（四）农户质押贷款（含农户最高额质押贷款）。',33,1),(3571,59,0,'','（五）组合担保贷款等。',34,1),(3572,59,0,'','',35,1),(3573,59,1,'h1','第四章  贷款方式',36,1),(3574,59,0,'','第十一条  贷款方式。',37,1),(3575,59,0,'','农户贷款方式在有效防控风险的前提下，可采用信用、保证、抵押、质押、组合担保等方式。以企业法人、融资性担保机构和其他经济组织或政策规定可以作为担保人的，执行有关规定。',38,1),(3576,59,0,'','第十二条  采取担保方式办理农户贷款的，担保人、抵（质）押物应符合《中华人民共和国担保法》《中华人民共和国物权法》等国家法律法规的相关规定。',39,1),(3577,59,0,'','第十三条  以农户为保证人的，原则上保证人为贷款人评定的信用农户，且符合贷款人的其他规定。',40,1),(3578,59,0,'','',41,1),(3579,59,1,'h1','第五章  贷款期限、利率与还款方式',42,1),(3580,59,0,'','第十四条  贷款期限。',43,1),(3581,59,0,'','贷款人应根据贷款项目生产销售周期、经营周期和综合还款能力及意愿等因素合理确定。',44,1),(3582,59,0,'','第十五条  贷款利率。',45,1),(3583,59,0,'','贷款人应按照贷款利率覆盖风险及信用状况与利率挂钩的原则，综合考虑信用状况、贷款方式、风险水平、存款贡献、业务往来等要素及农户生产经营利润率和支农惠农要求，合理确定差别化贷款利率。',46,1),(3584,59,0,'','第十六条  还款方式。',47,1),(3585,59,0,'','农户贷款还款方式根据贷款种类、期限及借款人现金流情况，可采用分期还本付息、分期还息到期还本、利随本清、等额本金、等额本息等合理确定。1年期以上贷款不得采用利随本清方式。',48,1),(3586,59,0,'','',49,1),(3587,59,1,'h1','第六章  受理与调查',50,1),(3588,59,0,'','第十七条  农户贷款操作流程：调查、建档、评级、授信、贷款发放、贷后管理。',51,1),(3589,59,0,'','第十八条  农户小额信用贷款按照“一次核定、随用随贷、余额控制、周转使用、动态管理”的模式进行管理，在确定信用授信限额后实行柜面放贷或线上渠道办贷；农户其他贷款按照“逐笔申请、逐笔审批发放”的模式进行管理。针对乡村振兴特色优势农业产业贷款，可以适当采取批量授信、快速审批模式进行管理。行社应根据实际情况制定贷款管理审批权限。',52,1),(3590,59,0,'','第十九条  农户申请贷款除以书面形式提出贷款申请外，还需提供能够证明其符合贷款条件的相关资料。',53,1),(3591,59,0,'','第二十条  贷款受理。',54,1),(3592,59,0,'','贷款人收到借款申请资料后，应在规定时限内及时受理，并履行尽职调查职责，对贷款申请内容和相关情况的真实性、准确性、完整性进行调查核实，对信用状况、风险、收益进行评价，形成调查评价意见。',55,1),(3593,59,0,'','第二十一条  贷前调查应包括但不限于下列内容：',56,1),(3594,59,0,'','（一）提交的资料是否完整、真实、有效。',57,1),(3595,59,0,'','（二）借款申请人经营管理能力、生产经营状况、近期主要收入支出。',58,1),(3596,59,0,'','（三）借款用途是否真实。',59,1),(3597,59,0,'','（四）项目预期风险收益情况。',60,1),(3598,59,0,'','（五）借款申请人还款来源、还款能力、还款意愿及还款方式。',61,1),(3599,59,0,'','（六）借款申请人借款方式、担保人担保意愿、担保能力或抵（质）押物价值及变现能力。',62,1),(3600,59,0,'','（七）核实抵（质）押物的权属及各项权证真实性等情况。',63,1),(3601,59,0,'','（八）原则上须查询借款申请人、担保人的个人信用信息基础数据库情况。',64,1),(3602,59,0,'','（九）对客户提供的复印件应与原件核对一致，由调查人员在复印件上签署“与原件核对相符”字样，调查人员须签署个人姓名确认。',65,1),(3603,59,0,'','第二十二条  贷前调查应当深入了解借款人收支、经营情况，以及人品、信用等信息。严格执行双人调查、实地调查制度，并与借款申请人及其家庭成员进行面谈，形成面谈记录。有效借助村委会、德高望重村民、经营共同体带头人等社会力量及其他客观真实的凭证或证明材料，准确了解借款申请人的基本情况、信用及经营状况。',66,1),(3604,59,0,'','第二十三条  信贷调查结束后，调查人员应根据调查情况，出具明确的调查意见。',67,1),(3605,59,0,'','第二十四条  授信额度。',68,1),(3606,59,0,'','（一）信用授信额度。以农户及家庭信誉为基础，综合家庭基本情况、家庭资产、家庭收入、业务往来、道德品质、信用记录、公共记录等情况合理核定。',69,1),(3607,59,0,'','（二）担保类授信额度。应根据农户信用记录、偿债意愿、偿债能力、担保情况、贷款情况、贷款用途等合理核定。',70,1),(3608,59,0,'','第二十五条  贷款额度。',71,1),(3609,59,0,'','根据农户经营项目、消费种类的用途、实际投入、自有资金及综合偿债能力情况合理确定。',72,1),(3610,59,0,'','',73,1),(3611,59,1,'h1','第七章  审查、风险评价与审批',74,1),(3612,59,0,'','第二十六条  审查及风险评价。',75,1),(3613,59,0,'','（一）贷款审查。行社信贷业务管理部门（授信审批部门）承担信贷业务的合规性审查职责，合规性审查主要审查行业准入政策、借款人主体资格、基本资料、资产负债、评级授信、贷款用途、担保等情况，审查人员审查结束后应出具明确的合规性审查意见或报告，并签字确认。',76,1),(3614,59,0,'','1.审查人员应对申报资料的完整性、有效性、一致性，以及借款人的主体资格、信贷业务的合规合法性进行审查，并对借款人的财务状况、经营管理情况、信贷业务的可行性、风险状况、效益情况作出评价。',77,1),(3615,59,0,'','2.对不符合国家产业政策、信贷政策或存在其他重大问题的，审查人员可直接将申报资料退回。',78,1),(3616,59,0,'','3.审查通过的，审查人员应出具合规性审查意见；资料不完整的应及时反馈，并要求补充完善相关资料和信息。',79,1),(3617,59,0,'','（二）风险评价。风险管理部门承担信贷业务的风险评价职责。有效识别各类风险，重点对可能影响信贷业务风险的因素进行评价，同时提出风险管控意见或措施，出具客观、详实的风险评价报告。',80,1),(3618,59,0,'','1.小额授信业务和低风险业务的风险评价可由本级合规性审查人员一并完成。',81,1),(3619,59,0,'','2.大额授信业务和高风险业务由信贷业务管理部门（授信审批部门）进行合规性审查后，再由风险管理部门进行风险评价。',82,1),(3620,59,0,'','3.各行社应根据自身业务发展规模、风险防控能力、经营管理水平，合理确定小额授信业务、大额授信业务、高风险业务的边界和范围。',83,1),(3621,59,0,'','（三）信贷业务管理部门（授信审批部门）、风险管理部门应独立介入合规性审查和风险评价工作，应根据不同业务品种特点，按照职责对提交的授信资料和调查意见进行合规性审查及风险评价。审查评价过程中有疑问的，审查人可要求补充或完善相关资料，必要时可独立进行现场核查。',84,1),(3622,59,0,'','（四）小额授信业务和低风险业务仅需出具审查意见，大额授信业务和高风险业务须出具合规性审查报告和风险评价报告，合规性审查人员和风险评价人员对报告内容的真实性、完整性、有效性负责。',85,1),(3623,59,0,'','第二十七条  贷款审批。',86,1),(3624,59,0,'','合规性审查及风险评价完成后，将合规性审查及风险评价意见（报告）与申报资料一并提交有权审批人审批。审批人在充分审阅申报资料的基础上，根据国家有关宏观经济政策、法律法规、贵州省农村信用社的信贷规章制度等，按照效益覆盖风险和成本的原则，独立行使审批决策权。',87,1),(3625,59,0,'','（一）审批方式。贷款人应根据待审议事项的复杂程度，按照“风险控制、效率兼顾”的原则，可以采取会议审批，会签审批，专职审批人审批，独立审批等方式。',88,1),(3626,59,0,'','（二）审批结论反馈。经审批通过的授信业务，要及时以书面形式批复，申报网点要严格按照审批结论办理。审批结论为“同意”（含限制性条件同意）的，在落实好附加条件后即可办理具体信贷业务。审批未通过的，可直接将申报资料退回。',89,1),(3627,59,0,'','',90,1),(3628,59,1,'h1','第八章  发放与支付',91,1),(3629,59,0,'','第二十八条  落实用款条件。根据审批意见和约定事项，与借款人协商落实用款条件。用款条件包括：',92,1),(3630,59,0,'','（一）借款人已在贷款人处开立个人银行结算账户。',93,1),(3631,59,0,'','（二）担保措施已有效落实。',94,1),(3632,59,0,'','（三）与借款人约定的其他条件已经满足。',95,1),(3633,59,0,'','第二十九条  签订合同。经审批同意的贷款，贷款人应加强对借款人的身份审验，确认借款人与指定账户真实性，防范假名、借名、冒名贷款问题。根据审批意见和有关规定与借款人、担保人（抵押人、出质人或保证人）当面签订书面借款合同、担保合同及其他相关协议。面签要求如下：',96,1),(3634,59,0,'','（一）在签订有关法律文书前，贷款人应充分履行告知义务。',97,1),(3635,59,0,'','（二）在签订有关法律文书时，应当面核验签约人身份证明，由签约人当场签字加盖手印。',98,1),(3636,59,0,'','第三十条  合同使用。',99,1),(3637,59,0,'','（一）农户小额信用贷款统一使用《贵州省农村信用社自然人最高额循环借款合同》。',100,1),(3638,59,0,'','（二）农户其他贷款，根据借款方式，相应签订借款合同及担保合同。',101,1),(3639,59,0,'','第三十一条  借款合同生效后，贷款人应当遵循审贷与放贷分离的原则，加强对贷款的发放管理，设立独立的放款管理部门或岗位，负责落实放款条件，对满足约定条件的借款人发放贷款。',102,1),(3640,59,0,'','第三十二条  支付管理。有下列情形之一的农户贷款，经贷款人同意可以采取借款人自主支付：',103,1),(3641,59,0,'','（一）农户生产经营贷款且金额不超过50万元，或用于农副产品收购等无法确定交易对象的。',104,1),(3642,59,0,'','（二）农户消费贷款且金额不超过30万元。',105,1),(3643,59,0,'','（三）借款人交易对象不具备有效使用非现金结算条件的。',106,1),(3644,59,0,'','（四）法律法规规定的其他情形。',107,1),(3645,59,0,'','鼓励采用贷款人受托支付方式向借款人交易对象进行支付。',108,1),(3646,59,0,'','第三十三条  采用借款人自主支付的，贷款人应当与借款人在借款合同中明确约定；贷款人应当通过账户分析或现场调查等方式，核查贷款使用是否符合约定用途。',109,1),(3647,59,0,'','第三十四条  贷款发放时，必须将款项转入指定的借款人结算账户，严禁以现金方式发放贷款，确保资金发放给真实借款人。',110,1),(3648,59,0,'','',111,1),(3649,59,1,'h1','第九章  贷后管理',112,1),(3650,59,0,'','第三十五条  贷后检查。',113,1),(3651,59,0,'','（一）贷款发放半年内应开展首次贷后检查。原则上贷款到期前每年检查不低于两次，行社可根据贷款额度大小、产业风险特点、贷款管理能力等因素，合理确定农户贷款贷后检查频度。',114,1),(3652,59,0,'','（二）贷后检查方式分为现场检查和非现场检查，对于借款人能够正常还本付息的，可通过非现场方式进行检查；非现场检查发现借款人还本付息不正常或以下情形之一的，应及时进行现场检查。',115,1),(3653,59,0,'','1.借款人无故逃逸、隐匿、被司法机关羁押、逮捕等。',116,1),(3654,59,0,'','2.借款人存在违法经营行为。',117,1),(3655,59,0,'','3.借款人生产经营不正常，资产明显减少，还款能力明显降低，影响贷款偿还的。',118,1),(3656,59,0,'','4.借款人死亡或家庭主要关系人发生经济纠纷的。',119,1),(3657,59,0,'','5.拒绝接受贷款监督，挪用贷款或转移收入、资产，贷款逾期，拖欠利息等行为。',120,1),(3658,59,0,'','6.其他重大风险事项。',121,1),(3659,59,0,'','（三）检查情况填写贷后检查表或撰写贷后检查报告。',122,1),(3660,59,0,'','第三十六条  日常监测。在贷后检查过程中或通过其他渠道，发现借款人有第三十五条第（二）款规定情形之一的，应及时提出有效的风险控制措施，并以书面形式向网点负责人报告。',123,1),(3661,59,0,'','第三十七条  风险预警。贷款人应当建立风险预警制度，定期跟踪分析评估借款人履行借款合同约定内容以及抵质押担保情况，及时发现借款人、担保人的潜在风险并发出预警提示，采取增加抵质押担保、调整授信额度、提前收回贷款等措施，并作为后续信用评价的基础。',124,1),(3662,59,0,'','第三十八条  贷款收回。短期贷款到期1个星期之前、中长期贷款到期1个月之前，贷款人以书面、电话、短信等形式提示借款人、担保人按时归还贷款本息。',125,1),(3663,59,0,'','第三十九条  贷款展期。对于因自然灾害、农产品价格波动等客观原因造成借款人无法按原定期限正常还款的，由借款人申请，经贷款人同意，可以对还款意愿良好、预期现金流量充分、具备还款能力的农户贷款进行合规展期。申请保证贷款、抵押贷款、质押贷款展期的，还应当由保证人、抵押人、出质人出具同意的书面证明。已有约定的，按照约定执行。已展期贷款不得再次展期。短期贷款展期期限不得超过原贷款期限;中期贷款展期期限不得超过原贷款期限的一半;长期贷款展期期限不得超过3年。',126,1),(3664,59,0,'','第四十条  资产保全。贷款人对逾期贷款应当及时催收，按逾期时间长短和风险程度逐级上报处理，掌握借款人动态，及时采取措施保全信贷资产安全。',127,1),(3665,59,0,'','第四十一条  贷款重组。对于未按照借款合同约定收回的贷款，应当采取措施进行清收，也可以在利息还清、本金部分偿还、原有担保措施不弱化等情况下协议重组。',128,1),(3666,59,0,'','第四十二条  贷款核销。对确实无法收回的农户贷款，贷款人可以按照相关规定进行核销，按照账销案存原则继续向借款人追索或进行市场化处置，并按责任制和容忍度规定，落实有关人员责任。',129,1),(3667,59,0,'','第四十三条  风险分类。贷款人严格按照风险分类的规定，对农户贷款进行准确分类及动态调整，真实反映贷款形态。展期贷款最高列入关注类进行管理。',130,1),(3668,59,0,'','第四十四条  行社风险管理部门、审计部门等部门应当对分支机构贷后管理情况进行检查。建立贷款本息独立对账制度、不定期重点检（抽）查制度以及至少两年一次的全面交叉核查制度，重点排查防范假名、借名、冒名贷款。',131,1),(3669,59,0,'','',132,1),(3670,59,1,'h1','第十章  档案管理',133,1),(3671,59,0,'','第四十五条  农户贷款档案实行电子化管理与纸质档案管理相结合。具有法律文书性质的纸质信贷档案由行社妥善保管并扫描至信贷管理系统对应功能模块系统存储。有价单证、抵押登记凭证、权利证书等重要凭证应视同现金入库保管，并记载登记簿。',134,1),(3672,59,0,'','',135,1),(3673,59,1,'h1','第十一章  激励与约束',136,1),(3674,59,0,'','第四十六条  行社要以风险调整收益为基础，制定农户贷款可持续发展的绩效薪酬管理制度，绩效薪酬考核权重应当对农户贷款业务予以倾斜，体现多劳多得、效益与风险挂钩的激励约束要求。',137,1),(3675,59,0,'','第四十七条  行社应当以支持农户贷款发展为基础，建立科学合理的农户贷款定期考核制度，对农户贷款的服务、管理、质量等情况进行考核，并给予一定的容忍度。主要考核指标包括但不限于：',138,1),(3676,59,0,'','（一）农户贷款户数、金额（累放、累收及新增）、工作量、农户贷款占比等服务指标。',139,1),(3677,59,0,'','（二）农户贷款到期本金回收率、利息回收率及增减变化等管理指标。',140,1),(3678,59,0,'','（三）农户贷款不良率、不良贷款迁徙率及增减变化等质量指标。',141,1),(3679,59,0,'','第四十八条  贷款人开展农户贷款业务应当维护借款人权益，严禁向借款人预收利息、收取账户管理费用、搭售金融产品等不规范经营行为。',142,1),(3680,59,0,'','第四十九条  行社应当建立包含农户贷款业务在内的尽职免责制度、违法违规处罚制度和容忍度机制。尽职无过错，且风险在容忍度范围内的，应当免除责任；超过容忍度范围的，相关人员应当承担失职责任；违规办理贷款的，应当严肃追责处罚。',143,1),(3681,59,0,'','第五十条  贷款人内部工作人员违规处罚。贷款人应加强农户贷款的贷前、贷中及贷后管理，若有以下情形之一的，应视情节轻重，按照省联社员工违规行为处罚相关规定、行业规章及法律法规进行处罚：',144,1),(3682,59,0,'','（一）与借款人串通，发放假名、借名、冒名贷款，骗取贷款人贷款的。',145,1),(3683,59,0,'','（二）违规设置贷款条件办理贷款，直接或间接参与借款人经营、入股分红、占用或变相占用借款人信贷资金的。',146,1),(3684,59,0,'','（三）利用职务上的便利，索取、收受贿赂或者违反国家规定收受各种名义的回扣、手续费的。',147,1),(3685,59,0,'','（四）参与非法集资、发放高利贷的。',148,1),(3686,59,0,'','（五）应予处罚的其他情形。',149,1),(3687,59,0,'','第五十一条  贷款人要建立优质农户与诚信客户正向激励制度，对存款贡献度大、按期还款、信用良好的借款人可采取利率优惠、利息返还、信用累积奖励等方式，促进信用环境不断改善。',150,1),(3688,59,0,'','第五十二条  借款人贷款违约责任。有以下情形之一的，应视情节轻重，对借款人采取取消信用等级及授信额度、停止发放新贷款、限期收回已发放贷款等处理措施；情节严重的，通过司法程序处理：',151,1),(3689,59,0,'','（一）借款人采取欺骗手段，假名、借名、冒名骗取贷款的。',152,1),(3690,59,0,'','（二）借款人故意隐瞒贷款真实用途，将信贷资金挪作民间借贷、高利贷、非法集资等非法用途的。',153,1),(3691,59,0,'','（三）法律法规规定的应予处罚的其他情形。',154,1),(3692,59,0,'','',155,1),(3693,59,1,'h1','第十二章  附  则',156,1),(3694,59,0,'','第五十三条  本办法由省联社负责解释、修订。',157,1),(3695,59,0,'','第五十四条  本办法自印发之日起施行。《省联社办公室关于印发贵州省农村信用社“致富通”农户贷款管理办法的通知》（黔农信办发〔2013〕178号)同时废止。',158,1),(3696,59,0,'','',159,1),(3697,59,0,'','',160,1),(3698,59,0,'','',161,1),(3699,59,0,'','',162,1),(3700,59,0,'','',163,1),(3701,59,0,'','',164,1),(3702,59,0,'','',165,1),(3703,59,0,'','',166,1),(3704,59,0,'','',167,1),(3705,59,0,'','',168,1),(3706,59,0,'','',169,1),(3707,59,0,'','',170,1),(3708,59,0,'','',171,1),(3709,59,0,'','',172,1),(3710,59,0,'','',173,1),(3711,59,0,'','',174,1),(3712,59,0,'','',175,1),(3713,59,0,'','',176,1),(3714,59,0,'','',177,1),(3715,59,0,'','',178,1),(3716,59,0,'','',179,1),(3717,59,0,'','共印120份',180,1),(3718,60,0,'','50',1,1),(3719,61,0,'','',0,1),(3720,61,0,'','各审计中心，各联社、农商银行:',1,1),(3721,61,0,'','经省联社首届理事会第五十三次会议及首届社员大会讨论通过，现将《贵州省农村信用社现金业务管理暂行办法》（以下简称《办法》印发给你们，并提出以下要求，请一并遵照执行。',2,1),(3722,61,0,'','一、原《贵州省农村信用社现金业务管理办法》（黔农信财〔2005〕1号）、《贵州省农村信用社出纳业务基本操作规程》（黔农信财〔2005〕4号）同时废止。',3,1),(3723,61,0,'','二、《办法》中第八条所指的机构职责具体为：',4,1),(3724,61,0,'','（一）省联社运营服务中心负责制定现金业务各项规章制度；负责反假货币工作管理;按人行相关要求收集、分析、报告现金业务信息；现金业务机具设备选型和管理；现金业务日常管理、培训、检查与指导工作。',5,1),(3725,61,0,'','（二）省联社信息科技中心负责现金业务相关系统开发和维护。',6,1),(3726,61,0,'','（三）省联社安全保卫部负责现金押运、库房值守以及相关制度建设。',7,1),(3727,61,0,'','',8,1),(3728,61,0,'','',9,1),(3729,61,0,'','',10,1),(3730,61,0,'','2018年2月23日',8,1),(3731,61,0,'','',12,1),(3732,61,0,'','',13,1),(3733,61,0,'','',14,1),(3734,61,0,'','贵州省农村信用社现金业务管理暂行办法',9,1),(3735,61,0,'','',16,1),(3736,61,1,'h1','第一章  总  则',10,1),(3737,61,0,'','第一条  为规范贵州省农村信用社、农村商业银行（以下简称各行社）现金业务管理，提高现金业务工作质量，保证现金业务安全高效运行，根据《中华人民共和国人民币管理条例》、《中华人民共和国现金管理暂行条例》及有关法律法规，结合贵州农信实际，制定本办法。',11,1),(3738,61,0,'','第二条  现金业务是指现金的收付、兑换、整点、清分、缴存以及现金实物的调拨、保管等业务活动及管理。',12,1),(3739,61,0,'','第三条　现金业务管理的主要内容：',13,1),(3740,61,0,'','（一）按照现金管理规定及相关制度，办理现金收付、调拨、整点、清分、兑换以及机具管理等工作。',14,1),(3741,61,0,'','（二）做好现金备付管理，科学核定与调剂现金库存限额，保证支付，提高现金周转率。',15,1),(3742,61,0,'','（三）加强尾箱、库房管理，严格查库制度，确保资金安全。',16,1),(3743,61,0,'','（四）宣传爱护人民币，做好人民币的防假反假工作，推进人民币净化工程。',17,1),(3744,61,0,'','（五）及时处理现金差错，做好案件防控工作。',18,1),(3745,61,0,'','（六）建立现金业务信息分析和报告机制。',19,1),(3746,61,0,'','（七）建立现金统计制度。',20,1),(3747,61,0,'','（八）对现金业务工作进行监督和检查，并建立考核与奖惩机制。',21,1),(3748,61,0,'','（九）加强柜面监督，及时分析汇总可疑现金交易信息，揭露洗钱等违法活动。',22,1),(3749,61,0,'','第四条  经办现金业务的机构，应按照监管机构及本行安全标准设置作业区域，确保现金人员和现金实物的安全。作业区域包括业务库库区、网点营业区、自助设备配钞区等。',23,1),(3750,61,0,'','第五条  办理现金业务应坚持双人临柜、双人管库，交接清楚，责任分明。实物作业必须纳入监控范围，按国家、行业及省联社有关安全防范标准安装物防、技防设施设备，不得有监控盲区，并按相关规定妥善保管监控资料。',24,1),(3751,61,0,'','第六条  各行社必须为现金业务人员配备保证生命安全和身体健康的防护用品。营业机构应制定防火、防抢、防盗和设备出现故障时的应急预案，并按要求进行应急处置操作培训和演练。',25,1),(3752,61,0,'','第七条  本办法适用于贵州省农村信用社、农村商业银行办理现金业务的机构。',26,1),(3753,61,0,'','',34,1),(3754,61,1,'h1','第二章  机构职责及岗位设置',27,1),(3755,61,0,'','第八条  省联社负责全省现金业务指导协调和监督管理。',28,1),(3756,61,0,'','（一）负责制定现金业务各项规章制度。',29,1),(3757,61,0,'','（二）负责反假货币工作管理。',30,1),(3758,61,0,'','（三）按人行相关要求收集、分析、报告现金业务信息。',31,1),(3759,61,0,'','（四）负责现金业务机具设备选型和管理。',32,1),(3760,61,0,'','（五）负责现金业务日常管理、培训、检查与指导工作。',33,1),(3761,61,0,'','（六）负责现金业务相关系统开发和维护。',34,1),(3762,61,0,'','（七）负责现金押运、库房值守以及相关制度建设。',35,1),(3763,61,0,'','第九条  审计中心负责辖内现金业务检查与指导工作，收集、分析、报告现金业务信息以及反假货币等工作。',36,1),(3764,61,0,'','第十条  各行社负责辖内现金日常管理与指导。',37,1),(3765,61,0,'','（一）根据现金业务相关制度，明确责任部门，设置专职和兼职现金管理人员；制定现金业务人员上岗及业务技能考核的具体标准；制定现金业务学习培训计划，定期不定期组织培训。',38,1),(3766,61,0,'','（二）负责辖内柜面现金收付、备付、调拨、保管、机具管理、反假货币管理以及推进人民币净化工程等工作。',39,1),(3767,61,0,'','（三）负责对辖内机构现金业务进行指导、监督、检查及考核。',40,1),(3768,61,0,'','（四）负责建立健全大额现金支取、现金差错的审批和处理机制，并贯彻落实。',41,1),(3769,61,0,'','（五）负责辖内机构现金业务信息以及反假货币的收集、整理、分析和报告。',42,1),(3770,61,0,'','（六）负责对现金业务岗位人员实施日常管理，关注其思想动态和行为表现，纠正违章操作。',43,1),(3771,61,0,'','（七）其他现金业务管理工作。',44,1),(3772,61,0,'','第十一条  各行社须遵循钱账分管、相互制约的原则，合理配备现金业务人员。与现金业务相关的岗位包括：行社现金业务管理岗、业务库主管岗、行社库管岗、解款岗、网点库管岗、现金收付岗等。行社可根据业务需要结合自身实际情况，单独设立清分岗。',45,1),(3773,61,0,'','（一）行社现金业务管理岗。负责传达贯彻现金业务各项规章制度并按管理要求组织实施，设定现金备付计划，制定学习培训计划并组织培训，监督、指导辖内机构日常现金业务工作。',46,1),(3774,61,0,'','（二）业务库主管岗。负责管理行社现金总库工作；行社对外现金调拨、行社内部现金调缴业务；按规定履行授权审批职责以及行社现金总库的其他日常工作。 ',47,1),(3775,61,0,'','（三）行社库管岗。配合业务库主管做好行社现金总库的管理工作。负责现金出入库管理，库房管理，现金整点、清分、交存及账务处理等日常管理工作。',48,1),(3776,61,0,'','（四）解款岗。负责现金接送库、调缴业务的跟车押运、箱包清点以及交接登记等工作。',49,1),(3777,61,0,'','（五）网点库管岗。负责网点现金出入库、库房管理、现金整点、调缴以及账务处理等日常管理工作。',50,1),(3778,61,0,'','（六）现金收付岗。负责办理柜面现金收付、兑换、假币收缴、现金整点、上缴等日常业务及账务处理，柜员尾箱管理以及其他现金业务。',51,1),(3779,61,0,'','第十二条  各行社根据业务需要和风险控制原则对营业机构和库房的重要岗位设立A、B角，并实行轮岗管理，对重要岗位人员实行强制休假制度。',52,1),(3780,61,0,'','',61,1),(3781,61,1,'h1','第三章  现金柜面业务管理',53,1),(3782,61,0,'','第十三条  现金柜面业务是指直接为客户办理的各项现金收付、兑换等业务。',54,1),(3783,61,0,'','第十四条  基本规定：',55,1),(3784,61,0,'','（一）收付现金，做到核验身份、当面点清。收入现金先收款后记账，付出现金先记账后付款，兑换现金先兑入后兑出。',56,1),(3785,61,0,'','（二）一笔现金业务未完成，经办人员不得离柜或办理其他业务。',57,1),(3786,61,0,'','（三）不得对外支付假币、残损币、反宣币等，人民币收付现金质量必须达到人民银行规定的行业标准。',58,1),(3787,61,0,'','（四）收付现金必须经过符合冠字号码记录标准的点钞机或清分机清点，才能循环使用。',59,1),(3788,61,0,'','（五）现金收付必须符合反洗钱的有关规定。',60,1),(3789,61,0,'','第十五条  现金收款业务，是指办理存款、贷款、结算等业务时向客户收取现金的业务。',61,1),(3790,61,0,'','（一）现金收款业务办结时，相关业务凭证经客户签字确认后将现金放入尾箱保管。',62,1),(3791,61,0,'','（二）收入现金，当面点清，一笔一清，不得将多笔款项合并收入。上门收取的现金当日清点入账，因特殊原因无法清点入账的，应注明收款时间及收款人，参照尾箱管理单独封存入库，并至迟下一工作日清点入账。',63,1),(3792,61,0,'','（三）客户交存的现金无法即时或当面清点的，可签订协议办理“封包收款”，适当延长清点时间。当日未清点入账的余款，参照尾箱管理单独封存入库，入账金额以清点完毕的实有数为准。',64,1),(3793,61,0,'','第十六条  现金付款业务，是指办理存款、贷款、结算等业务时向客户支付现金的业务。须严格执行大额现金预约、审批制度。',65,1),(3794,61,0,'','（一）各行社应根据人民银行等相关部门管理规定，制定符合本地市场需求的预约机制，对取现金额较大、取现时间集中、金额票面有特殊要求的可办理预约付款业务。客户一次性取现金额超过预约起点的，营业机构应当要求其提前1天以上以电话或其他方式预约。在约定支取日客户未办理支取的，预约失效，客户必须重新办理预约。',66,1),(3795,61,0,'','（二）提取大额现金的客户，需按支付网点预约起点金额规定提前办理预约事宜；营业机构应及时通过系统登记备查。',67,1),(3796,61,0,'','（三）各行社应建立大额现金支取审批制度，规范管理大额现金支付活动。',68,1),(3797,61,0,'','第十七条  各行社应根据人民银行管理规定制定小面额（20元及以下面额）人民币支取、兑换预约机制。客户一次性支取、兑换数量超过人民银行规定的银行业金融机构网点小面额人民币日备数量，营业机构应当要求其提前1天以上以电话或其他方式预约。在约定支取日客户未办理支取的，预约失效，客户必须重新办理预约。',69,1),(3798,61,0,'','第十八条  现金兑换业务。主要包括票面调换、残损币兑换。票面调换是指对零币换整币、整币换零币业务的处理。残损币兑换是指对残损币作全额、半额兑换业务的处理。应按现金收付操作程序办理，坚持先收后付的原则。',70,1),(3799,61,0,'','（一）营业机构应无偿为公众办理现金兑换业务，且不得拒绝。',71,1),(3800,61,0,'','（二）残缺、污损人民币按照《中国人民银行残缺、污损人民币兑换办法》规定办理。',72,1),(3801,61,0,'','（三）收回的残损人民币根据《不宜流通人民币 纸币》行业标准不得再流通使用。',73,1),(3802,61,0,'','（四）因残缺、污损币兑换发生的收益、损失，应按规定进行长短款挂账处理，并按照长短款结转损益的规定进行结转。',74,1),(3803,61,0,'','第十九条  办理现金收付业务时，应按照人民银行要求做到交易流水与冠字号码记录匹配，客户因涉假纠纷申请查询冠字号码的，应严格按照冠字号码查询解决涉假纠纷相关规定执行。',75,1),(3804,61,0,'','',85,1),(3805,61,1,'h1','第四章  现金备付管理',76,1),(3806,61,0,'','第二十条  现金备付包括行社业务库现金、营业机构现金、自助设备现金及在途现金。',77,1),(3807,61,0,'','第二十一条  现金备付管理应遵循以下原则：',78,1),(3808,61,0,'','（一）限额管理。合理核定行社总库、营业机构业务库、自助银行的现金备付限额。',79,1),(3809,61,0,'','（二）确保支付。现金备付要能保证各营业机构、自助银行的正常支付。',80,1),(3810,61,0,'','（三）节约成本。妥善安排现金缴领，在确保支付的前提下尽可能压缩现金备付，降低资金占用成本。',81,1),(3811,61,0,'','（四）动态调整。根据业务发展、现金收付的季节性特点等因素对现金备付限额标准进行动态调整。',82,1),(3812,61,0,'','第二十二条  各行社应根据辖内现金收支净额、活期存款占比、历史现金备付限额等相关数据，结合地区特点、现金投放回笼淡旺季特点、业务发展、送钞难易度等情况合理确定并下发现金备付限额标准，并定期（半年或一年）调整。',83,1),(3813,61,0,'','第二十三条  营业机构应加强现金备付限额的管理，及时调缴，不得任意调整、突破备付限额。库存超限的应及时向行社主管部门报备，如需临时调整，应报行社主管部门审批。',84,1),(3814,61,0,'','第二十四条  各行社应建立现金备付的考核制度，每日监控超限情况。发现营业机构超过限额的，应及时向超限机构了解具体情况，超限机构应如实汇报超限原因，如存在重大风险隐患，应及时采取措施，并向上级机构主管部门报告。',85,1),(3815,61,0,'','',96,1),(3816,61,1,'h1','第五章  现金调拨业务',86,1),(3817,61,0,'','第二十五条  现金调拨业务是指本行社与人行发行库、本行社与同业、行社内机构之间、机构内柜员之间发生的现金往来。分为对外现金调拨、现金调缴和柜员现金调剂。',87,1),(3818,61,0,'','第二十六条  对外现金调拨是指行社业务库向人民银行发行库、其他商业银行或其他行社支取、缴存现金。',88,1),(3819,61,0,'','（一）本行社与人行发行库提缴现金只限于行社营业部及以上机构办理，不允许营业机构直接向人民银行提缴现金。',89,1),(3820,61,0,'','（二）各行社营业机构由行社审批同意后方可与同业或其他行社办理现金提缴业务。',90,1),(3821,61,0,'','（三）提取或缴存现金，必须按人行规定或同业协定，由双方认可的专人办理，清点、交接清楚，当天入库、入账。',91,1),(3822,61,0,'','第二十七条  现金调缴业务是指营业机构向行社业务库缴存现金或行社业务库向营业机构调拨现金，分为现金缴款和现金调款。',92,1),(3823,61,0,'','（一）由营业机构库管员发起调缴申请，须经上级机构现金管理员或其授权的柜员审批，经审批同意后办理配款、配车，双方清点无误后办理现金出入库。',93,1),(3824,61,0,'','（二）现金缴款和现金调款应及时入账，确保账实相符。',94,1),(3825,61,0,'','（三）现金调款应建立分级审批制度。',95,1),(3826,61,0,'','（四）使用箱包调缴现金的，如使用普通锁具须采取加锁卡封条等有效措施确保箱包锁具完整性，接收方应检查确认箱包锁具送达收款机构时是否完整。',96,1),(3827,61,0,'','第二十八条  柜员现金调剂。营业柜员现金不足或超限时，可向其他柜员调剂。款项交接须在网点负责人、业务主管或指定专人监督下办理，当面清点，交接清楚并在交接凭证上签字确认。',97,1),(3828,61,0,'','',109,1),(3829,61,1,'h1','第六章  尾箱管理',98,1),(3830,61,0,'','第二十九条  尾箱分为系统柜员钱箱和实物尾箱。',99,1),(3831,61,0,'','（一）系统柜员钱箱指核心系统中用于记录柜员日常现金收付、贵金属增减、重要单证使用情况的电子钱箱。',100,1),(3832,61,0,'','（二）实物尾箱指柜员用于放置本外币现金、贵金属、有价证券、重要单证、业务公章等的钱箱。',101,1),(3833,61,0,'','第三十条  系统柜员钱箱实行以岗设箱、一岗一箱、限额管理的原则。营业机构业务主管应定期或不定期的对系统柜员钱箱超限情况进行检查，对超限的应查明原因，及时调缴或报备；柜员应适时清点实物尾箱，确保与系统柜员钱箱账实相符。',102,1),(3834,61,0,'','第三十一条  实物尾箱的设置、使用、交接及出入库，遵循以下规则：',103,1),(3835,61,0,'','（一）尾箱管理应以“方便业务、双人双锁、钥匙分管、确保安全”为原则。',104,1),(3836,61,0,'','（二）营业前，柜员必须检查实物尾箱封口及锁卡封条等是否完好，清点现金，确保与接收账务账实核对相符。',105,1),(3837,61,0,'','（三）营业期间，大额现金应入保险柜保管。柜员中途离岗应将现金、重空、印章入箱上锁，不得交由他人保管，并置于有效监控范围下。',106,1),(3838,61,0,'','（四）营业终了，柜员清点现金与系统柜员钱箱数据核对无误，登记券别，并换人卡把复核，确保账实相符，业务主管复点大数后，双人入箱、双人上锁，将尾箱交库管员或解款员。使用普通锁具的，同一尾箱钥匙必须由双人妥善保管，且同一人不能同时保管同一尾箱钥匙；如使用密码或其他验证码锁具的，行社应制定有效的保管措施。保管尾箱钥匙的人员需将钥匙封装后放入监控范围内保险柜妥善保管，不得随身携带。',107,1),(3839,61,0,'','（五）次日休息柜员办理交接后原则上不得保留现金和重要空白凭证，因特殊原因不能办理交接的需经营业机构负责人审批并报行社业务主管部门备案。',108,1),(3840,61,0,'','（六）柜员换班、出差、休假、离职前必须对尾箱内实物进行清点，并核对相符，轧账后参照（四）、（五）办理交接。',109,1),(3841,61,0,'','（七）尾箱不在网点保管需交行社业务库寄库保管的，如使用普通锁具须采取加锁卡封条等有效措施确保箱包锁具完整性。由业务主管及柜员双人将尾箱交解款员，解款员清点尾箱数量，核对无误后，双方在《库箱（包）交接登记簿》上签字确认。',110,1),(3842,61,0,'','（八）解款员与营业机构办理尾箱的交接，签收前必须核验运钞车及解款员身份信息，交接、签收必须在防尾随互锁联动安全门内，交接时，防尾随互锁联动安全门内门应关闭，并在有效的视频监控下进行。',111,1),(3843,61,0,'','',124,1),(3844,61,1,'h1','第七章  业务库管理',112,1),(3845,61,0,'','第三十二条  业务库是保管现金、贵金属、有价单证以及其他有价值品、印章、柜员尾箱等实物的场所。分为行社业务库和网点业务库。',113,1),(3846,61,0,'','第三十三条  业务库实行双人管库制度。管库出纳必须坚持同开库、同进库、同在库、同出库及同锁库，严禁单人操作。',114,1),(3847,61,0,'','第三十四条  业务库钥匙管理',115,1),(3848,61,0,'','（一）业务库房金库门配备有专用锁的，锁具应配备正、副钥匙各一套，正钥匙由管库员掌管使用，如专有锁为单钥匙的，掌握正钥匙的管库员不得同时掌握所有的机械密码锁密码，如专用锁为双钥匙的，正钥匙应由两名管库员分别保管使用，做到定人保管、定向交接，严禁将金库门钥匙交由他人代开，金库门必须随开随闭。',116,1),(3849,61,0,'','（二）副钥匙交行社分管领导封存保管，除发生特殊事故外不得启封动用。',117,1),(3850,61,0,'','（三）必须动用副钥匙时，须经行社领导批准，由保管人、营业机构负责人、业务主管和管库员共同启封，登记动用时间和原因，如有必要应采取进一步的安全措施。',118,1),(3851,61,0,'','（四）业务库保管区设有指纹、密码锁的，指纹、密码记录也按上述要求办理。',119,1),(3852,61,0,'','（五）业务库钥匙如有丢失、损坏或密码失密的，必须查明原因，追究责任，并立即报告相关管理部门，经批准同意后，将整套库门钥匙或密码更换，并作好详细记录备查。',120,1),(3853,61,0,'','第三十五条  业务库中现金、有价单证、贵金属不能混合码放,有条件的，应实行分库或分区管理。',121,1),(3854,61,0,'','（一）成箱（袋）现金应封装整齐，分类别码放；成捆现金按券别分完整券、残损券分类码放。',122,1),(3855,61,0,'','（二）贵金属产品应按种类分类保管。',123,1),(3856,61,0,'','（三）库内应保持整洁，不得存放其他物品。',124,1),(3857,61,0,'','第三十六条  现金入库清点时必须坚持双人交接、双人拆封、双人作业。',125,1),(3858,61,0,'','第三十七条  现金清分是指对人民币现金进行面额和套别区分、真假币鉴别、数量统计，并按照人民银行颁布的人民币流通标准进行质量分类的处理过程。现金清分包括机械清分和手工清分。',126,1),(3859,61,0,'','（一）缴存人民银行的现金，必须进行现金清分，未经清分、整点的现金不得对外支付或缴入人民银行发行库。',127,1),(3860,61,0,'','（二）10元及以上面额必须全额机械清分，5元及以下券别如不适合使用机械清分，可以组织手工清分。',128,1),(3861,61,0,'','（三）钱捆质量除必须符合人民银行发行库管理规定外，缴存人民银行发行库现金应在已清分的钱捆上标记“已清分”标识。当地人民银行对于现金整点、扎把、打捆有特殊要求的，从其规定。',129,1),(3862,61,0,'','第三十八条  现金整点，要遵照“五好钱捆”的要求，做到点准、墩齐、挑净、捆紧、盖章清楚。整点现金应按百张（硬币伍拾或壹佰枚）为把（卷），拾把（卷）为捆。成捆纸币（硬币）须捆扎（封装）并加贴封签。',130,1),(3863,61,0,'','第三十九条  业务库保管的现金必须坚持每天盘库结账，由管库出纳双人盘库、交叉复核，保证账实相符。',131,1),(3864,61,0,'','第四十条  管库员因临时离岗、休假或岗位调整等，应按照平行移交模式办理交接手续。移交人应将所保管的账款、物品详细填列移交清单；接收人对交接账款、物品进行清查核对，账实相符后由交接双方当面办理交接，移交人、接收人、监交人三方签章，明确责任。',132,1),(3865,61,0,'','',146,1),(3866,61,1,'h1','第八章  查库管理',133,1),(3867,61,0,'','第四十一条  各行社须坚持定期查库，查库人员不得低于2人。',134,1),(3868,61,0,'','（一）行（社）分管行长（主任）、现金业务管理部门查库，每季不少于一次，抽查网点不低于1个。',135,1),(3869,61,0,'','（二）营业机构负责人、会计主管查库，每周不少于一次。',136,1),(3870,61,0,'','第四十二条  查库手续',137,1),(3871,61,0,'','本行社查库人员（营业网点自查除外）必须持相关检查文书及检查人身份证件。',138,1),(3872,61,0,'','（二）本行社以外的单位需对库房及其守卫的安全情况进行检查的，须经行社管理部门同意，并出示检查文书和检查人员身份证件，在行社保卫人员陪同下进行检查。',139,1),(3873,61,0,'','（三）检查文书应注明姓名、人数、有效日期及被查单位名称，文书规定以外的人员不得查库，超期限的检查文书不予受理，检查文书须交被查行社留存。',140,1),(3874,61,0,'','第四十三条  查库主要内容',141,1),(3875,61,0,'','（一）清点柜员库存现金（自助机具现金实物的清查按相关规定执行）是否与账、簿记载相符，库存是否合理；有无白条抵库或挪用库款的情况；在途资金是否及时处理;',142,1),(3876,61,0,'','（二）库房（保险柜）的锁和钥匙的使用和管理是否符合规定；',143,1),(3877,61,0,'','（三）是否坚持执行双人管库及双人守库；',144,1),(3878,61,0,'','（四）假币、反宣币等保管是否符合有关规定。',145,1),(3879,61,0,'','（五）票币整理是否符合要求；库款摆列是否整洁，有无存放违反规定的物品，是否发生虫蛀、鼠咬及霉烂事故。',146,1),(3880,61,0,'','第四十四条  查库要求',147,1),(3881,61,0,'','（一）查库时，查库人员应认真履行查库职责，逐张、逐枚清点现金和实物，核对实有库存现金，并在查库登记表上登记签字，查库结果由被查机构相关人员签章确认。',148,1),(3882,61,0,'','（二）查库工作应全程在有效的监控下进行，确保查库时双人在场。内部人员查库，应在业务系统中登记查库情况 ；外部人员查库应根据查库情况填制《查库登记簿》，由管库出纳在《查库登记簿》上签字确认，并将查库介绍信粘贴在其背面备查。',149,1),(3883,61,0,'','（三）查库必须坚持“查必彻底”的原则，不得以部分检查或抽查替代全面查库。查库发现问题，必须及时查明原因，彻底整改，不留隐患。查库人员实施查库期间，现金管库员（现金柜员）不得离开查库现场。',150,1),(3884,61,0,'','（四）夜间检查只准查岗不准查库。',151,1),(3885,61,0,'','（五）查库前任何人不得通知被查单位或被查人员，不得泄露任何有关查库信息。',152,1),(3886,61,0,'','（六）查库后，查库人员应逐级汇报查库结果。如发现重大问题，要立即查明原因，并及时上报上级主管机构。',153,1),(3887,61,0,'','',168,1),(3888,61,1,'h1','第九章  反假反宣工作管理',154,1),(3889,61,0,'','第四十五条  各行社应按照人民银行要求,规范对假币的收缴、鉴定行为，并落实反假培训、宣传等工作。',155,1),(3890,61,0,'','第四十六条  假币是指伪造、变造的货币。',156,1),(3891,61,0,'','伪造的货币是指仿照真币的图案、形状、色彩等，采用各种手段制作的假币。',157,1),(3892,61,0,'','变造的货币是指在真币的基础上，利用挖补、揭层、涂改、拼凑、移位、重印等多种方法制作，改变真币原形态的假币。',158,1),(3893,61,0,'','第四十七条  营业机构配备的自助设备、出纳机具必须具备假币识别的功能。营业机构需配备货币真伪鉴别设备。',159,1),(3894,61,0,'','第四十八条  假币收缴。',160,1),(3895,61,0,'','（一）办理业务时发现的假币，要依法予以收缴。办理假币收缴业务的人员应取得相关资格证书，收缴假币时，应由两人及以上人员按规定办理，当面收缴，向持有人出具“假币收缴凭证”，并履行告知义务。',161,1),(3896,61,0,'','（二）外部机构（含人民银行、同业及辖内营业机构）调入现金，在清点钞币时如发现假币，经在场两人以上鉴别属实，应立即与调出单位联系，经调出单位确认后，按现金出纳错款处理，由调入单位开具“假币收缴凭证”交由调出单位。',162,1),(3897,61,0,'','第四十九条  假币鉴定。',163,1),(3898,61,0,'','（一）有权鉴定假币的机构为中国人民银行当地分支机构和中国人民银行授权的鉴定机构。',164,1),(3899,61,0,'','（二）持有人对被收缴货币的真伪有异议，可以自收缴之日起３个工作日内，持“假币收缴凭证”直接或通过收缴单位向有权鉴定假币的机构提出书面鉴定申请。',165,1),(3900,61,0,'','（三）对盖有“假币”字样戳记的人民币纸币、对收缴的各种硬币，经鉴定为真币的，由鉴定机构交收缴营业机构按照面额兑换完整券退还持有人，收回持有人的“假币收缴凭证”；盖有“假币”戳记的人民币按损伤人民币处理，不得截留或私自处理鉴定的假币。',166,1),(3901,61,0,'','第五十条  收缴的假币，不得再交予持有人。收缴假币过程中有下列情形之一的，应当立即报告当地公安机关，提供有关线索：',167,1),(3902,61,0,'','（一）一次性发现假人民币20张、枚（含20张、枚）以上，假外币10张、枚（含10张、枚）以上的；',168,1),(3903,61,0,'','（二）属于利用新的造假手段制造假币的；',169,1),(3904,61,0,'','（三）有制造贩卖假币线索的；',170,1),(3905,61,0,'','（四）持有人不配合金融机构收缴行为的。',171,1),(3906,61,0,'','第五十一条  经办人员应使用人民银行假币收缴系统对收缴的假币进行登记，收缴和没收的假币应按照当地人民银行的要求及时解缴。',172,1),(3907,61,0,'','第五十二条  当地人民银行对假币的收缴、鉴定、保管、上缴等业务另行规定的，遵照当地人民银行规定执行。',173,1),(3908,61,0,'','第五十三条  反宣币是指印有反动言论的纸币。反宣币工作是现金管理工作重要组成部分，各行社须长期、持续开展。',174,1),(3909,61,0,'','（一）办理现金收付时，如发现反宣币，应做好登记工作，不得再进入市场流通。',175,1),(3910,61,0,'','（二）对一次性发现大量假币或反宣币，要立即向当地人民银行及公安机关报告。',176,1),(3911,61,0,'','（三）对于大量兑换小面额人民币的客户，需掌握其详细信息，发现可疑之处应立即报告当地人行及公安机关。',177,1),(3912,61,0,'','（四）反宣币上缴人民银行工作与反假人民币上缴工作同步进行。',178,1),(3913,61,0,'','',194,1),(3914,61,1,'h1','第十章  机具管理',179,1),(3915,61,0,'','第五十四条  经办现金业务的机构应配备业务机具，包括点钞机、清分机、捆钞机、扎把机、款箱、货币鉴伪设备等，负责业务机具管理、维护、登记、保管等工作。',180,1),(3916,61,0,'','第五十五条  出纳机具应符合国家和行业的标准，满足现金业务使用需要。',181,1),(3917,61,0,'','第五十六条  各级会计与营运部门应指定专人建立出纳机具档案，配合相关部门做好出纳机具的维护和管理。',182,1),(3918,61,0,'','第五十七条  业务库作业区必须配备满足现金业务使用的捆钞机、打把机、清分机等出纳机具。',183,1),(3919,61,0,'','第五十八条  办理现金业务的柜员必须配备一台点验钞机，营业窗口应为客户提供人民币点验钞机具。',184,1),(3920,61,0,'','',201,1),(3921,61,1,'h1','第十一章 现金差错及案件处理',185,1),(3922,61,0,'','第五十九条  现金差错是指办理现金业务过程中发生的长、短款。现金案件是指因盗窃、抢劫、诈骗、贪污、挪用造成现金短款。',186,1),(3923,61,0,'','第六十条  调拨现金发现长、短款，应保管好原封签，腰条等资料，立即与调出机构联系查找原因，确认为调出机构的差错时，以清点的实际金额入账；不能确定调出机构差错时，由调入行按审批权限报批处理。',187,1),(3924,61,0,'','第六十一条  原封新票币发现长、短款，应保留原捆票币及腰条、封签，写出情况报告，经手人、复核人签章，经负责人及主管行领导审核后，连同原封签、腰条等送当地人民银行审查处理。',188,1),(3925,61,0,'','第六十二条  银行自助设备清机中发现长、短款，应立即向机构负责人报告并于当日挂账，及时查明原因，按相关规定处理。由于设备故障引起的长、短款，要及时与设备生产厂家联系协调处理。',189,1),(3926,61,0,'','第六十三条  柜员收付现金发现长、短款，必须立即向业务主管报告；发生一万（含）元以上长短款，业务主管要立即向行社管理部门报告。错款原因不明或属责任事故的，经过有权人审批后，按照长款归公、短款自赔的原则处理，长款不得侵吞，短款不得自补不报，不得以长补短。查无结果按规定挂账。对确实无法挽回的错款，在认真调查的基础上，区别不同性质分别对待，正确处理。',190,1),(3927,61,0,'','（一）技术性错款处理。网点人员或出纳人员在执行制度的前提下，由于系统、机具故障等原因导致的现金差错无法追回时，不追究经办人责任。',191,1),(3928,61,0,'','（二）责任性错款处理。对工作不负责任、有章不循或违反纪律发生的差错，无论数额大小，要追究经济责任或给予适当行政处分。由于负责人违反制度造成错款事故，要追究负责人责任。',192,1),(3929,61,0,'','（三）对于监守自盗、贪污盗窃等违法行为，应追回赃款，并视情节轻重给予行政处分或追究刑事责任。',193,1),(3930,61,0,'','第六十四条  当日发生的各类长、短款，必须当日挂账。现金错款的长短款挂账，单笔挂账时间超过一年（含银行自助设备），且不追究经办人员责任，又无法取得厂家或保险公司赔偿的，经行社审批后进行损益处理；需追究责任的差错款无法追回时，按照呆账核销相关管理办法处理；现金案件的长短款转损益，应根据法院判决结果进行处理。',194,1),(3931,61,0,'','第六十五条  发生现金出纳案件，要保护现场，并按案件上报流程及时逐级上报。发生暴力、盗窃、抢劫、诈骗、贪污、挪用造成的现金短款，应根据案件处理规定及时逐级上报并保护现场。',195,1),(3932,61,0,'','',213,1),(3933,61,1,'h1','第十二章  现金业务分析',196,1),(3934,61,0,'','第六十六条  现金业务分析是在日常业务的基础上，根据会计账簿、会计报表及业务活动所反映的相关数据，分析各级机构的现金业务经营现状及发展情况，以进一步加强风险管控、提升资金效益、提高现金出纳管理水平。',197,1),(3935,61,0,'','第六十七条  各行社应根据实际需要、监管部门、上级机构的要求，按月、季、年对本辖区内的现金业务进行统计和分析。',198,1),(3936,61,0,'','第六十八条  现金业务分析的内容主要包括但不限于：',199,1),(3937,61,0,'','（一）根据现金业务量的增减变化情况以及影响因素，研究其变化规律，以便及时调配人员，合理组织开展现金业务。',200,1),(3938,61,0,'','（二）对现金业务的工作效率及质量进行分析，及时发现工作流程及业务操作环节上的问题。',201,1),(3939,61,0,'','（三）现金业务指标分析包括现金备付情况分析、在途资金分析、现金超限情况分析等。',202,1),(3940,61,0,'','',221,1),(3941,61,1,'h1','第十三章  业务检查',203,1),(3942,61,0,'','第六十九条  各级现金业务管理部门应定期、不定期地开展辖区内现金业务的检查工作。',204,1),(3943,61,0,'','各级检查人员对所辖机构的现金人员负有业务指导与监督责任，以保障各项法规、制度地贯彻执行，发现重大问题及时向上级单位和当地人民银行报告。',205,1),(3944,61,0,'','第七十条  业务检查包括机构人员管理，操作规程制定，制度执行情况，库存（尾箱）现金、实物管理，出纳机具使用保管情况及其他情况。',206,1),(3945,61,0,'','第七十一条  现金业务检查分为现场检查和非现场检查。',207,1),(3946,61,0,'','（一）现场检查是指检查人员亲临实地通过盘点实物、调阅资料等方式实施的检查。',208,1),(3947,61,0,'','（二）非现场检查是指检查人员通过电子手段调阅相关资料方式实施的远程检查。',209,1),(3948,61,0,'','',229,1),(3949,61,1,'h1','第十四章  考核与奖惩',210,1),(3950,61,0,'','第七十二条  省联社对各行社现金业务工作进行监督和检查。各行根据当地人民银行有关规定结合实际自行制定现金业务考核办法。',211,1),(3951,61,0,'','第七十三条  考核内容包括但不限于现金柜面业务操作、现金机构管理、限额管理、尾箱管理、缴拨与运送、现金检查、自助设备与现金业务机具管理及维护、反假货币工作、宣传培训等。',212,1),(3952,61,0,'','第七十四条  凡属下列情况之一者应予以表彰。',213,1),(3953,61,0,'','（一）全年无差错事故的；',214,1),(3954,61,0,'','（二）发现和堵住大额错款、诈骗冒领案件，保住银行资金安全的；',215,1),(3955,61,0,'','（三）反假货币工作成绩突出的；',216,1),(3956,61,0,'','（四）在处置突发事件中，采取积极应变措施，及时有效处理的。',217,1),(3957,61,0,'','第七十五条  对于违规违章操作的人员以及现金业务事故、现金业务案件的有关责任人，按照有关规定处理，涉及刑事案件的，应移送司法机关。',218,1),(3958,61,0,'','第七十六条  营业机构存在违反现金出纳管理规定，允许单位和个人违规、超额提取现金，给国家和集体造成损失或形成严重风险的，其上级机构应当按照有关制度规定，对直接责任人和负有管理责任的人员给予相应的经济处罚和纪律处分，情节严重的，应移交司法机关。',219,1),(3959,61,0,'','第七十七条  对用人不当、管理混乱、检查不严、监督不力、违章不究，导致资金和信誉遭受严重损失的，追究相关人员责任。',220,1),(3960,61,0,'','',241,1),(3961,61,1,'h1','第十五章  附  则',221,1),(3962,61,0,'','第七十八条  各行社可根据当地人民银行要求、结合自身实际情况，在本规定框架下制定补充规定或实施细则。',222,1),(3963,61,0,'','第七十九条  本规定由省联社负责解释、修改，并自下发之日起实施。',223,1),(3964,61,0,'','',245,1),(3965,61,0,'','',246,1),(3966,61,0,'','',247,1),(3967,61,0,'','',248,1),(3968,61,0,'','',249,1),(3969,61,0,'','',250,1),(3970,61,0,'','',251,1),(3971,61,0,'','',252,1),(3972,61,0,'','',253,1),(3973,61,0,'','',254,1),(3974,61,0,'','',255,1),(3975,61,0,'','',256,1),(3976,61,0,'','',257,1),(3977,61,0,'','共印120份',224,1),(3978,62,0,'','',0,1),(3979,62,0,'','各支行：',1,1),(3980,62,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',2,1),(3981,62,0,'','一、多头贷款的定义',3,1),(3982,62,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',4,1),(3983,62,0,'','二、相关要求',5,1),(3984,62,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',6,1),(3985,62,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',7,1),(3986,62,0,'','',8,1),(3987,62,0,'','兴仁农商银行办公室',9,1),(3988,62,0,'','                                     2017年10月9日',10,1),(3989,62,0,'','',11,1),(3990,62,0,'','                                               共印48份',12,1),(3991,62,0,'','',13,1),(3992,62,0,'','',14,1);

/*Table structure for table `clause_file` */

DROP TABLE IF EXISTS `clause_file`;

CREATE TABLE `clause_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `clause_id` int(11) DEFAULT NULL COMMENT '管理办法ID',
  `file_id` int(11) DEFAULT NULL COMMENT '附件ID',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1已删）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;

/*Data for the table `clause_file` */

/*Table structure for table `confirmation` */

DROP TABLE IF EXISTS `confirmation`;

CREATE TABLE `confirmation` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '确认书ID',
  `draft_id` int(11) NOT NULL DEFAULT '0' COMMENT '工作底稿ID',
  `confirmation_receipt_id` int(11) NOT NULL DEFAULT '0' COMMENT '确认书回执ID',
  `file_id` int(11) DEFAULT '0' COMMENT '图片ID',
  `has_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已读（0未读|1已读）',
  `has_read_time` timestamp NULL DEFAULT NULL COMMENT '已读时间',
  `proposal` varchar(2000) DEFAULT NULL COMMENT '单位意见或者建议',
  `state` enum('draft','publish') NOT NULL DEFAULT 'draft' COMMENT '状态（draft草稿|publish发布）',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `year` year(4) DEFAULT NULL COMMENT '年份',
  `number` int(11) DEFAULT NULL COMMENT '编号',
  `author_id` int(11) DEFAULT NULL COMMENT '创建人id',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1删除）',
  PRIMARY KEY (`id`),
  KEY `工作底稿` (`draft_id`)
